using namespace std::literals;

using ll = long long;
constexpr int MAX_N = 1e5;
std::array<int, MAX_N> x1_over, x2_over;

class Solution {
public:
  ll minCost(std::vector<int>& b1, std::vector<int>& b2) {
    const int n = b1.size();
    std::sort(b1.begin(), b1.end());
    std::sort(b2.begin(), b2.end());
    const ll min_db = ll(std::min(b1[0], b2[0])) << 1;
    
    auto n1 = 0, n2 = 0, i1 = 0, i2 = 0;
    while (i1 < n && i2 < n) {
      if (b1[i1] < b2[i2]) {
        x1_over[n1++] = b1[i1++];
      } else if (b1[i1] > b2[i2]) {
        x2_over[n2++] = b2[i2++];
      } else { // b1[i1] == b2[i2]
        ++i1, ++i2;
      }
    }
    while (i1 < n) x1_over[n1++] = b1[i1++];
    while (i2 < n) x2_over[n2++] = b2[i2++];
    
    if (n1 != n2 || (n1 & 1))
      return -1;
    for (auto i = 1; i < n1; i += 2) if (x1_over[i-1] != x1_over[i]) return -1;
    for (auto i = 1; i < n2; i += 2) if (x2_over[i-1] != x2_over[i]) return -1;
    
    ll res = 0;
    auto l1 = 0, r1 = n1 - 1, l2 = 0, r2 = n2 - 1;
    while (l1 <= r1 && l2 <= r2) {
      const auto mn1 = x1_over[l1], mx1 = x1_over[r1];
      const auto mn2 = x2_over[l2], mx2 = x2_over[r2];
      if (min_db <= std::min(mn1, mn2)) {
        res += min_db;
        l1 += 2, l2 += 2;
      } else if (std::tie(mn1, mx1) <= std::tie(mn2, mx2)) {
        res += mn1;
        l1 += 2, r2 -= 2;
      } else {
        res += mn2;
        r1 -= 2, l2 += 2;
      }
    }
    return res;
  }
};

